import {Route ,Redirect} from 'react-router-dom'
const token = localStorage.getItem("token")

alert("loin " + token)
export const PrivateRoute = ({ component: Component, ...rest }) => (
    
<Route {...rest} render={(props) => (
    token === null
    ? <Component {...props} />
    : <Redirect to={{
        pathname: '/',
        state: { from: props.location }
        }} />
        
)} />
)
